    false,nt"url": null,nt"notes": "This data, exported from Google Analytics
    displays the most popular 50 pages on Austintexas.gov based on the following: rnPageviews:
    The total number of times the page was viewed. Repeated views of a single page are
    counted.rnUnique Pageviews: The number of visits during which the specified page
    was viewed at least once. A unique pageview is counted for each page URL + page
    Title combination.rnAverage Time on Page: The average amount of time users spent
    viewing a specified page or screen, or set of pages or screens.rnEntrances: The
    number of times visitors entered your site through a specified page or set of pages.rnBounce
    Rate: The percentage of single-page visits (i.e. visits in which the person left
    your site from the entrance page without interacting with the page).rnPercent Exit:
    (number of exits) / (number of pageviews) for the page or set of pages. It indicates
    how often users exit from that page or set of pages when they view the page(s).
    This demonstrates the top 50 pages for a three-month period.",nt"license_title":
